import React from "react";
import "../components/NewExpense/NewExpense.css";
const OurForm = () => {
  return (
    <form>
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>Title</label>
          <input type="text" />
        </div>
      </div>
    </form>
  );
};

export default OurForm;
